.editApiDialog {
    .el-button {
        width: 80px;
        height: 28px;
        background: #79ac43;
        color: #fff;
        border-radius: 8px;
        justify-content: center;
    }
    .apiName {
        display: flex;
        justify-content: space-between;
        margin-bottom: 24px;
        .el-input {
            width: 150px;
            margin: 0 8px;
        }
    }
    .params {
        p {
            display: flex;
            padding-left: 80px;
            margin: 0 0 8px 0;
            .el-input {
                width: 150px;
                margin: 0 24px 0 12px;
            }
        }
    }
    .btns {
        margin-top: 50px;
        display: flex;
        justify-content: center;
        align-items: center;
    }
}
